import "./aboutMe.css";

export default function AboutMe () {
    return (
        <>
            <h1>About Me</h1>
            <div class="funky-text">Example of how to use css</div>
            <p>this color is actually called dodgerblue in the css source code, cool!</p>
        </>
    );
};
